  width: 100%;
  flex: 3;

  display: flex;
  justify-content: center;
  align-items: center;
`;

const MainImage = styled.img`
  width: 100%;
`;

export default function MediaArea() {
  return (
    <MediaAreaContainer>
      <MainImage />
    </MediaAreaContainer>
  );
}
